import React from 'react'

const Detail =({title, content , imageUrl , author})=> {
    return (
      <div>
        <h2>{title}</h2>
        <img src={imageUrl} alt="" />
        <p>{content}</p>
        <p>--{author}</p>
      </div>
    )
}

export default Detail
